ึกษาชั้นนำในต่างประเทศ\n\n• เครื่องทำน้ำอุ่น \n• แอร์ \n• TV\n• ตู้เย็น \n• สระว่ายน้ำ\n• ห้องออกกำลังกาย \n• สวนส่วนกลางขนาดใหญ่ใจกลางโครงการ \n• เจ้าหน้าที่รักษาความปลอดภัย 24 ชม. \n• ระบบ Key Card Access ควบคุมการเข้า - ออก \n• กล้องวงจรปิดตลอด 24 ชม. \n• ที่จอดรถ\n\nติดต่อฉันได้ตลอด 24 ชั่วโมง ถ้ามีปัญหา \n- ฉันหาไกด์นำเที่ยวให้คุณได้ ถ้าคุณต้องการ\n- ฉันดูแลคุณเวลามีปัญหา เช่น ไปประกันตัวคุณเวลาเมาแล้วขับ (ไม่แนะนำให้ทำ)\n\n• ห้างสรรพสินค้าเซ็นทรัลกาดสวนแก้ว\n• เซ็นทรัลแอร์พอร์ต\n• ห้างMaya \n• ตลาดต้นพยอม\n• กาดหน้ามอ  \n• โรงพยาบาลมหาราชเชียงใหม่ (รพ.สวนดอก)\n• โรงพยาบาลเชียงใหม่ (ราม) \n• สนามบินเชียงใหม่\n• พระธาตุดอยสุเทพ\n• สวนสัตว์เชียงใหม่\n• ถนนนิมมานเหมินท์\n• ร้านอาหารผาลาดตะวันรอน \n• ร้านค้าหลังมหาวิทยาลัยเชียงใหม่ หลากหลายร้านค้า คือหาของกินง่ายมากๆ\n\nคุณสามารถเดินเท้าไปมหาวิทยาลัยเชียงใหม่ และร้านค้าหลังมหาวิทยาลัยเชียงใหม่ได้\nแค่คุณเดินออกมาหน้าทางเขาคอนโด คุณสามารถใช้บริการรถรับจ้างของเชียงใหม่ได้ เช่น รถสี่ล้อแดง - รถตุ๊กตุ๊ก\n\n• ใกล้ร้านอาหารมากมายหลายร้าน อาจะทำให้คุณอ้วนได้\n• ใกล้ห้างสรรพสินค้าหลากหลายห้างอาจะทำให้ค่าช็อปปิ้งสูงมาก\n• ถ้าอยู่นานเกินไป คุณอาจทำใจย้ายไปอยู่ที่อื่นไม่ได้","localized_additional_house_rules":"- Please inform me your arrival time and check in time 1 day before your check in.\n- Please do not make a noise to disturb other especially after midnight.\n- Please turn off the air-conditioner when you leave the room.\n- Please inform me in advance if you want to renovate the room because there is the rule of room renovation.\n- Please do not use gas stove in the room\n\nห้ามส่งเสียงดังรบกวนข้างๆ ห้องมากเกินไป โดยเฉพาะหลังเที่ยงคืน\nกรุณาแจ้งฉันก่อน ถ้าคุณจะปรับปรุงห้อง เพราะมีกฎของคอนโดอยู่\nห้ามใช้เตาแกสในห้อง","localized_minimum_nights_description":"<strong&gt;2 คืน</strong&gt; การพักขั้นต่ำ","localized_sectioned_description":{"access":"• เครื่องทำน้ำอุ่น \n• แอร์ \n• TV\n• ตู้เย็น \n• สระว่ายน้ำ\n• ห้องออกกำลังกาย \n• สวนส่วนกลางขนาดใหญ่ใจกลางโครงการ \n• เจ้าหน้าที่รักษาความปลอดภัย 24 ชม. \n• ระบบ Key Card Access