																			<div data-review-id="103256320" class="review-text" data-reactid=".2cpq6v5mn7k.1.0.0.0.0.0.4.1.0.0.$103256320.1.0.0">
																				<div class="react-expandable" data-reactid=".2cpq6v5mn7k.1.0.0.0.0.0.4.1.0.0.$103256320.1.0.0.0">
																					<div class="expandable-content" data-reactid=".2cpq6v5mn7k.1.0.0.0.0.0.4.1.0.0.$103256320.1.0.0.0.0">
																						<p data-reactid=".2cpq6v5mn7k.1.0.0.0.0.0.4.1.0.0.$103256320.1.0.0.0.0.0">
																							真的是爆星推荐啊!非常完美。因为自己没有时间来交接钥匙,房东一直很耐心地跟我们沟通,让他弟弟来给我们钥匙。开头有些小插曲,因为tuktuk司机半路就把我们放下还说已经到了,虽然找了很久,可是当我们到达的时候真的很开心。位置在清迈大学那边,很方便,出去小区一条路都是小吃哈哈很开心,在清迈大学门口很容易叫车。房子更是让人满意,房东还很贴心地准备了糕点还有一些零食,里面什么都齐全又干净,还有阳台晾晒衣服。出入还要刷卡很安全啦。而且,还有泳池和健身房还可以租自行车。离开的时候真的不舍得,比我们的宿舍好太多了。总之,下次来还会选择这里的。开心
																						</p><div class="expandable-indicator" data-reactid=".2cpq6v5mn7k.1.0.0.0.0.0.4.1.0.0.$103256320.1.0.0.0.0.1"></div>
