																							The stay at Tik's place was great! The apartment was as expected and very clean, we really enjoyed our time in Chiang Mai. The only slight down side was that her brother (who checked us in/out), did not speak English. However Tik explained that she was out of town and was very responsive on the Air BnB app! Her brother was friendly nonetheless :) the apartment itself was lovely, very clean and modern inside! The location is a little bit of the city itself, but it is good to see a different side to the city! Plenty of food stalls/shops nearby due to the university! Also it is very cheap to get into the city (20-40thb in red taxi's)- so this is not an issue! Would stay again definitely :)
																						</p><div class="expandable-indicator" data-reactid=".2cpq6v5mn7k.1.0.0.0.0.0.4.1.0.0.$101341465.1.0.0.0.0.1"></div>
