																						<p data-reactid=".2cpq6v5mn7k.1.0.0.0.0.0.4.1.0.0.$99788180.1.0.0.0.0.0">
																							房东的服务很好,一早就让帅哥弟弟在小区等候,退房走的时候凌晨4点也准时来收钥匙。房间里干净整洁,空调、微波炉、热水器都很好用,洗发水、沐浴露、牙膏、浴巾、毛巾等必需用品一应俱全(牙刷除外哦),房东还很贴心的在厨房准备了即食面、速溶咖啡、面包、棉花糖,正好解决了早餐和宵夜问题呢。照片中的泳池非常棒,水很清很清、人也少,每晚游半小时确实感觉很爽。住所出来300多米靠近清迈大学后门有很多食肆和大排档、晚上也开哦,吃东西很方便,性价比也蛮高。临走才发现清迈大学正门那边有个很大的服装市场,可惜没有时间去逛了,再次吧。AIRbnb上的是女房东,可以用英文沟通,男房东则会说中文,但不会看和写中文,可以加(SENSITIVE CONTENTS HIDDEN)语聊。所有的都很好,如果说唯一美中不足的就是交通稍稍不是特别方便,小区走出300米才有双条车,机场接送最好提前预订,我接送机都是在去哪了定的,所以基本问题不大。总之好评,谢谢房东,有机会还会再来的哦。
																						</p><div class="expandable-indicator" data-reactid=".2cpq6v5mn7k.1.0.0.0.0.0.4.1.0.0.$99788180.1.0.0.0.0.1"></div>
