					<!--{"listing":{"additional_house_rules":"- Please inform me your arrival time and check in time 1 day before your check in.\n- Please do not make a noise to disturb other especially after midnight.\n- Please turn off the air-conditioner when you leave the room.\n- Please inform me in advance if you want to renovate the room because there is the rule of room renovation.\n- Please do not use gas stove in the room\n\nห้ามส่งเสียงดังรบกวนข้างๆ ห้องมากเกินไป โดยเฉพาะหลังเที่ยงคืน\nกรุณาแจ้งฉันก่อน ถ้าคุณจะปรับปรุงห้อง เพราะมีกฎของคอนโดอยู่\nห้ามใช้เตาแกสในห้อง","airbnb_plus_enabled":false,"airbnb_plus_matterport_url":null,"building_rules":null,"cancellation_policy":"moderate","cancellation_policy_category":"moderate","calendar_updated_at":"เมื่อ 3 วันก่อน","calendar_last_updated_at":"2016-10-04","city":"","city_guidebook":null,"country_code":"TH","description":"Dcondo campus resort in Doi Sutep Area\n\nRoom on the sixth floor of the condominium close to Chiang Mai University.\nThe condominium in Chiang Mai town where you can explore good experiences.\nWhere you can make all every day as the best day.\n\n• ติดมหาวิทยาลัยเชียงใหม่\n• ห้องชั้นบนสุด วิวดีมาก อากาศดีมาก ทำเลดีมาก  \n• ตั้งอยู่เชิงเขาอากาศบริสิทธิ์สดชื่นตลอดทั้งปี \n• หน้าหนาวอากาศจะเย็นกว่าที่อื่น \n• เนื้อที่โครงการกว้างมากถึง 8ไร่ มีพื้นที่สวนกว้างมาก-มากที่่สุด \n• Concept การ Design มีแรงบันดาลใจจากสถาบันการศึกษาชั้นนำในต่างประเทศ\n\n• เครื่องทำน้ำอุ่น \n• แอร์ \n• TV\n• ตู้เย็น \n• สระว่ายน้ำ\n• ห้องออกกำลังกาย \n• สวนส่วนกลางขนาดใหญ่ใจกลางโครงการ \n• เจ้าหน้าที่รักษาความปลอดภัย 24 ชม. \n• ระบบ Key Card Access ควบคุมการเข้า - ออก \n• กล้องวงจรปิดตลอด 24 ชม. \n• ที่จอดรถ\n\nติดต่อฉันได้ตลอด 24 ชั่วโมง ถ้ามีปัญหา \n- ฉันหาไกด์นำเที่ยวให้คุณได้ ถ้าคุณต้องการ\n- ฉันดูแลคุณเวลามีปัญหา เช่น ไปประกันตัวคุณเวลาเมาแล้วขับ (ไม่แนะนำให้ทำ)\n\n• ห้างสรรพสินค้าเซ็นทรัลกาดสวนแก้ว\n• เซ็นทรัลแอร์พอร์ต\n• ห้างMaya \n• ตลาดต้นพยอม\n• กาดหน้ามอ  \n• โรงพยาบาลมหาราชเชียงใหม่ (รพ.สวนดอก)\n• โรงพยาบาลเชียงใหม่ (ราม) \n• สนามบินเชียงใหม่\n• พระธาตุดอยสุเทพ\n• สวนสัตว์เชียงใหม่\n• ถนนนิมมานเหมินท์\n• ร้านอาหารผาลาดตะวันรอน \n• ร้านค้าหลังมหาวิทยาลัยเชียงใหม่ หลากหลายร้านค้า คือหาของกินง่ายมากๆ\n\nคุณสามารถเดินเท้าไปมหาวิทยาลัยเชียงใหม่ และร้านค้าหลังมหาวิทยาลัยเชียงใหม่ได้\nแค่คุณเดินออกมาหน้าทางเขาคอนโด คุณสามารถใช้บริการรถรับจ้างของเชียงใหม่ได้ เช่น รถสี่ล้อแดง - รถตุ๊กตุ๊ก\n\n• ใกล้ร้านอาหารมากมายหลายร้าน อาจะทำให้คุณอ้วนได้\n• ใกล้ห้างสรรพสินค้าหลากหลายห้างอาจะทำให้ค่าช็อปปิ้งสูงมาก\n• ถ้าอยู่นานเกินไป คุณอาจทำใจย้ายไปอยู่ที่อื่นไม่ได้","description_locale":"th","extra_host_languages":[],"guest_controls":{"allows_children":true,"allows_infants":true,"allows_pets":false,"allows_smoking":false,"allows_events":false,"id":8723365,"host_check_in_time_message":"Ruttikan สามารถรองรับเวลาเช็คอินใดก็ตาม","structured_house_rules":["ห้ามสูบบุหรี่","ไม่เหมาะสำหรับสัตว์เลี้ยง","ไม่มีงานสังสรรค์หรือเหตุการณ์","เวลาเช็คอินคือหลัง 14:00"],"structured_house_rules_with_tips":[{"text":"ห้ามสูบบุหรี่","tip":null},{"text":"ไม่เหมาะสำหรับสัตว์เลี้ยง","tip":null},{"text":"ไม่มีงานสังสรรค์หรือเหตุการณ์","tip":null},{"text":"เวลาเช็คอินคือหลัง 14:00","tip":null}]},"has_new_cancellation_policy":false,"host_guidebook":null,"house_rules":"- Please inform me your arrival time and check in time 1 day before your check in.\n- Please do not make a noise to disturb other especially after midnight.\n- Please turn off the air-conditioner when you leave the room.\n- Please inform me in advance if you want to renovate the room because there is the rule of room renovation.\n- Please do not use gas stove in the room\n\nห้ามส่งเสียงดังรบกวนข้างๆ ห้องมากเกินไป โดยเฉพาะหลังเที่ยงคืน\nกรุณาแจ้งฉันก่อน ถ้าคุณจะปรับปรุงห้อง เพราะมีกฎของคอนโดอยู่\nห้ามใช้เตาแกสในห้อง","id":8723365,"instant_bookable":false,"is_business_travel_ready":true,"listing_amenities":[{"explore_url":null,"icon":"icon-meal","id":8,"is_business_ready_feature":false,"is_present":true,"is_safety_feature":false,"name":"ห้องครัว","tag":"kitchen","tooltip":