รายสัปดาห์:","label_url":null,"value":"10%","value_url":null,"tag":null},"weekly_price":null,"weekend_price":{"attribute_url":null,"id":null,"label":"ราคาช่วงวันหยุดสุดสัปดาห์:","label_url":null,"value":"&amp;#3647;893 / คืน","value_url":null,"tag":null}},"property_type_id":1,"review_details_interface":{"display_review_summary":true,"host_other_property_review_count":0,"review_count":32,"review_score":98,"review_summary":[{"label":"ความถูกต้อง","value":10,"category":"accuracy"},{"label":"การสื่อสาร","value":10,"category":"communication"},{"label":"ความสะอาด","value":10,"category":"cleanliness"},{"label":"สถานที่","value":9,"category":"location"},{"label":"เช็คอิน","value":10,"category":"checkin"},{"label":"คุณค่า","value":10,"category":"value"}]},"should_show_complex_datepicker_prompt":false,"sorted_reviews":[{"comments":"很美很棒的现代公寓,房间一应俱全,社区服务完备,有游泳池 健身房 自行车供住户使用.公寓在清迈大学后门,有很多便宜好吃的小吃,到凌晨依旧热闹. 更值得一提的是主人非常的热情会跟你保持随时的互动,给予很多贴心的建议,特别喜欢她,很遗憾的就是她不住在清迈,没能见到她.但这不影响交流,非常推荐入住。\n The condo is perfect!Everyting is great ,I love this place.Thanks Ruttikan !I will be back :)","id":106056040,"localized_date":"ตุลาคม 2016","response":"","review_vote":{"downvote_count":null,"has_upvoted":false,"listing_id":8723365,"review_id":106056040,"upvote_count":null},"reviewee":{"first_name":"Ruttikan","host_name":"Ruttikan","id":45784117,"is_superhost":true,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/45784117","profile_pic_path":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium"},"reviewer":{"first_name":"Vickyliu","host_name":"Vickyliu","id":78775825,"is_superhost":false,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/pictures/35e5f43b-e15a-4e2c-a2e0-0d183cecf346.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/78775825","profile_pic_path":"https://a2.muscache.com/im/pictures/35e5f43b-e15a-4e2c-a2e0-0d183cecf346.jpg?aki_policy=profile_x_medium"}},{"comments":"Though did not have the pleasure of meeting Tik in person, she was always readily available to answer any questions through messages promptly. Her brother was always physically there to help with any assistance or arrangements when need be. Tik was an extremely attentive and generous host. Near the condo next to the university area it was very easy to find good coffee, food places and fruit stalls. Her place offers all toiletries and amenities for a comfortable stay. Would not hesitate to stay with her again in future. ","id":105258881,"localized_date":"ตุลาคม 2016","response":"","review_vote":{"downvote_count":null,"has_upvoted":false,"listing_id":8723365,"review_id":105258881,"upvote_count":null},"reviewee":{"first_name":"Ruttikan","host_name":"Ruttikan","id":45784117,"is_superhost":true,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/45784117","profile_pic_path":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium"},"reviewer":{"first_name":"Yoon-Kyung","host_name":"Yoon-Kyung","id":7195192,"is_superhost":false,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/users/7195192/profile_pic/1423577737/original.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/7195192","profile_pic_path":"https://a2.muscache.com/im/users/7195192/profile_pic/1423577737/original.jpg?aki_policy=profile_x_medium"}},{"comments":"This is my second time staying here and it never fails to impress me. Tik and her brother are very friendly host. They put in the effort to make the room clean and cosy. Would love to come back and stay again!","id":103326880,"localized_date":"กันยายน 2016","response":"","review_vote":{"downvote_count":null,"has_upvoted":false,"listing_id":8723365,"review_id":103326880,"upvote_count":null},"reviewee":{"first_name":"Ruttikan","host_name":"Ruttikan","id":45784117,"is_superhost":true,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/45784117","profile_pic_path":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium"},"reviewer":{"first_name":"Alvin","host_name":"Alvin","id":18702017,"is_superhost":false,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/pictures/2f8974a6-af9d-4b5e-923e-5d6f79ea5464.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/18702017","profile_pic_path":"https://a2.muscache.com/im/pictures/2f8974a6-af9d-4b5e-923e-5d6f79ea5464.jpg?aki_policy=profile_x_medium"}},{"comments":"真的是爆星推荐啊!非常完美。因为自己没有时间来交接钥匙,房东一直很耐心地跟我们沟通,让他弟弟来给我们钥匙。开头有些小插曲,因为tuktuk司机半路就把我们放下还说已经到了,虽然找了很久,可是当我们到达的时候真的很开心。位置在清迈大学那边,很方便,出去小区一条路都是小吃哈哈很开心,在清迈大学门口很容易叫车。房子更是让人满意,房东还很贴心地准备了糕点还有一些零食,里面什么都齐全又干净,还有阳台晾晒衣服。出入还要刷卡很安全啦。而且,还有泳池和健身房还可以租自行车。离开的时候真的不舍得,比我们的宿舍好太多了。总之,下次来还会选择这里的。开心","id":103256320,"localized_date":"กันยายน 2016","response":"I wait to host you again. ","review_vote":{"downvote_count":null,"has_upvoted":false,"listing_id":8723365,"review_id":103256320,"upvote_count":null},"reviewee":{"first_name":"Ruttikan","host_name":"Ruttikan","id":45784117,"is_superhost":true,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/45784117","profile_pic_path":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium"},"reviewer":{"first_name":"Irene","host_name":"Irene","id":37025769,"is_superhost":false,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/pictures/24945f73-a080-4a2f-b757-2055fd682b87.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/37025769","profile_pic_path":"https://a2.muscache.com/im/pictures/24945f73-a080-4a2f-b757-2055fd682b87.jpg?aki_policy=profile_x_medium"}},{"comments":"The owner was very responsive and she gave useful suggestions on places to go. The room is very clean and cosy. There is also microwave oven and a kettle in the pantry to prepare your food. Right outside the entrance there is a stretch of street food vendors at night selling really cheap food! Overall the experience is great. Would definitely come back to stay again!","id":101538141,"localized_date":"กันยายน 2016","response":"Was happy to host you again.","review_vote":{"downvote_count":null,"has_upvoted":false,"listing_id":8723365,"review_id":101538141,"upvote_count":null},"reviewee":{"first_name":"Ruttikan","host_name":"Ruttikan","id":45784117,"is_superhost":true,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/45784117","profile_pic_path":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium"},"reviewer":{"first_name":"Alvin","host_name":"Alvin","id":18702017,"is_superhost":false,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/pictures/2f8974a6-af9d-4b5e-923e-5d6f79ea5464.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/18702017","profile_pic_path":"https://a2.muscache.com/im/pictures/2f8974a6-af9d-4b5e-923e-5d6f79ea5464.jpg?aki_policy=profile_x_medium"}},{"comments":"The stay at Tik's place was great! The apartment was as expected and very clean, we really enjoyed our time in Chiang Mai. The only slight down side was that her brother (who checked us in/out), did not speak English. However Tik explained that she was out of town and was very responsive on the Air BnB app! Her brother was friendly nonetheless :) the apartment itself was lovely, very clean and modern inside! The location is a little bit of the city itself, but it is good to see a different side to the city! Plenty of food stalls/shops nearby due to the university! Also it is very cheap to get into the city (20-40thb in red taxi's)- so this is not an issue! Would stay again definitely :)","id":101341465,"localized_date":"กันยายน 2016","response":"I was happy to host you again.","review_vote":{"downvote_count":null,"has_upvoted":false,"listing_id":8723365,"review_id":101341465,"upvote_count":null},"reviewee":{"first_name":"Ruttikan","host_name":"Ruttikan","id":45784117,"is_superhost":true,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/45784117","profile_pic_path":"https://a2.muscache.com/im/pictures/8cf47fa7-0186-48c9-bfd7-badc0dd70029.jpg?aki_policy=profile_x_medium"},"reviewer":{"first_name":"Abigail","host_name":"Abigail","id":37166298,"is_superhost":false,"last_name":"prune_me","picture_url":"https://a2.muscache.com/im/users/37166298/profile_pic/1435698961/original.jpg?aki_policy=profile_x_medium","profile_path":"/users/show/37166298","profile_pic_path":"https://a2.muscache.com/im/users/37166298/profile_pic/1435698961/original.jpg?aki_policy=profile_x_medium"}},{"comments":"房东的服务很好,一早就让帅哥弟弟在小区等候,退房走的时候凌晨4点也准时来收钥匙。房间里干净整洁,空调、微波炉、热水器都很好用,洗发水、沐浴露、牙膏、浴巾、毛巾等必需用品一应俱全(牙刷除外哦),房东还很贴心的在厨房准备了即食面、速溶咖啡、面包、棉花糖,正好解决了早餐和宵夜问题呢。照片中的泳池非常棒,水很清很清、人也少,每晚游半小时确实感觉很爽。住所出来300多米靠近清迈大学后门有很多食肆和大排档、晚上也开哦,吃东西很方便,性价比也蛮高。临走才发现清迈大学正门那边有个很大的服装市场,可惜没有时间去逛了,再次吧。AIRbnb上的是女房东,可以用英文沟通,男房东则会说中文,但不会看和写中文,可以加(SENSITIVE CONTENTS HIDDEN)语聊。所有的都很好,如果说唯一美中不足的就是交通稍稍不是特别方便,小区走出300米才有双条车,机场接送最好提前预订,我接送机都是在去哪了定的,所以基本问题不大。总之好评,谢谢房东,有机会还会再来的哦。","id":99788180,"localized_date":"กันยายน 2016","response":"Thanks, I was happy to host you again.","review_vote":{"downvote_count":null,"has_upvoted":false,"listing_id":8723365,"review_id":99788180,"upvote_count":null},"reviewee":{"first_name":"Ruttikan","host_name":"Ruttikan","id":45784117,"is_superhost":true,"last_name":"prune_me","picture_ur